import React, { Component } from "react";
import { BrowserRouter as Router, Switch, Route } from "react-router-dom";
import AddKyc from "./add_kyc";
import ViewKyc from "./view_kyc";
import ModifyKyc from "./modify_kyc";

class BankHome extends Component {
  render() {
    return (
      <>
        <Router>
          <Switch>
            <Route exact path="/addkyc">
              <AddKyc />
            </Route>
            <Route exact path="/viewkyc">
              <ViewKyc />
            </Route>
            <Route exact path="/modifykyc">
              <ModifyKyc />
            </Route>
          </Switch>
        </Router>
      </>
    );
  }
}

export default BankHome;
